paper.abstract:
This study investigates the critical role of social identity in leadership, specifically examining identity leadership (IL) and the unique contributions of its four subdimensions: identity prototypicality, identity advancement, identity entrepreneurship, and identity impresarioship. To date, research has largely focused on the global construct of identity leadership and shown that in organizational contexts, it is a predictor of a range of outcomes, including group members’ burnout and organizational citizenship. However, the distinct roles of the four subdimensions remain little understood. Extending earlier findings, we address this gap by testing the hypothesis that the four subdimensions are differentially implicated in two key mechanisms that underlie the relationship between IL and group outcomes: (a) trust in the leader and (b) team identification. The present study explores this proposition by using structural equation modeling with latent factors to test a mediation model in 2020–2021 data from the Global Identity Leadership Development project (GILD;
N
= 7,855). As hypothesized, we found that identity prototypicality and identity advancement predominantly predicted greater trust in the leader, whereas identity entrepreneurship primarily predicted greater team identification. Contrary to our hypothesis, identity impresarioship showed a negative relation with trust. In turn, both trust in the leader and team identification were positively associated with organizational citizenship behavior (OCB), and negatively with burnout. We conclude by reflecting on the implications of these findings for both the theory and practice of leadership.
